            if item['header1'] == "Liabilities and Stockholders' Equity":
                deferred_revenue_as_reported = item['number_value']
            elif item['header1'] == "Stockholders' equity:":
                pass
        elif item['category'] == 'Other non-current liabilities (2)':
            if item['header1'] == "Liabilities and Stockholders' Equity":
                other_non_current_liabilities_as_reported = item['number_value']
            elif item['header1'] == "Stockholders' equity:":
                pass

    difference = abs(deferred_revenue_as_reported - other_non_current_liabilities_as_reported)

