def run(value_list):
    """
    Calculates the percentage of operating leases of more than 5 years in the total operating leases.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the calculated percentage.
    """
    operating_leases = []
    for item in value_list:
        if item['category'] == 'Operating leases':
            operating_leases.append(item)

    total_operating_leases = sum([item['number_value'] for item in operating_leases])
    more_than_5_years_leases = sum([item['number_value'] for item in operating_leases if item['header1'].startswith('(inthousands)'] and 'More Than 5 Years' in item['header2']])

    if total_operating_leases == 0:
        return (0.00, "")

    percentage = (more_than_5_years_leases / total_operating_leases) * 100
    return (round(percentage, 2), "")

