        value_list: A list of dictionaries, where each dictionary represents a year's data
                    and contains keys like 'number' and 'scale'.

    Returns:
        A tuple (number, scale).
    """
    shares_2018 = value_list[0]['number']
    shares_2019 = value_list[-1]['number']
    difference = abs(shares_2019 - shares_2018)

    if difference == 0:
        return (0.00, "")

    if difference == 1000000:
        return (1.00, "million")
    elif difference == 100000:
        return (1.00, "thousand")
    elif difference == 1000:
        return (1.00, "hundred")
    elif difference == 100:
        return (1.00, "ten")
    elif difference == 10:
        return (1.00, "ten")
    elif difference == 1:
        return (1.00, "one")
    else:
        return (round(difference, 2), "")

