def run(value_list):
    """
    Calculates the total percentage of revenue from Taiwan and Japan over total revenue in 2019,
    based on the geographic location of the customer's headquarters.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    revenue_2019 = 0.0
    revenue_taiwan_2019 = 0.0
    revenue_japan_2019 = 0.0

    for item in value_list:
        if item['header1'] == '2019':
            if item['category'] == 'Taiwan':
                revenue_taiwan_2019 += item['number_value']
            elif item['category'] == 'Japan':
                revenue_japan_2019 += item['number_value']
            else:
                revenue_2019 += item['number_value']

    total_revenue = revenue_2019
    if total_revenue == 0:
        return (0.00, "")

    percentage = (revenue_taiwan_2019 + revenue_japan_2019) / total_revenue
    return (percentage * 100, "percent")

