def run(value_list):
    """
    Calculates the percentage change in the total balance of goodwill of the Network Software & Systems segment in 2019 compared to 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    def extract_value(data, category, year):
        for item in data:
            if item['category'] == category and item['header1'] == 'Total' and item['scale'] == '':
                if year in item.keys():
                    return item[year]
        return None

    # Extract values for 2018 and 2019
    goodwill_2018_ns = extract_value(value_list, 'Goodwill acquired', '2018')
    goodwill_2019_ns = extract_value(value_list, 'Goodwill acquired', '2019')

    if goodwill_2018_ns is not None and goodwill_2019_ns is not None:
        change = (goodwill_2019_ns - goodwill_2018_ns) / goodwill_2018_ns
        percentage_change = change * 100
        return (round(percentage_change, 2), '')
    else:
        return (None, '')

